import React from 'react';
import logo from './images/ClimberCrewLogo.png';
import bg from './images/backgroundimage.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />


      </header>
      <body>
        <p>Climber Crew is a rock climbing adventure game with delightful ragdoll physics. Play solo and master each route on the map or race your friends in multiplayer for up to 4 players. Features endless rock walls to ascend, a diverse cast of climbers, and many fun surprises as you go.</p>

        <h2>Coming summer 2020</h2>
        <h3>Expected release on iPad, iPhone, PC, Switch, and more...</h3>


        <p>a game by Rob Quinn

        Copyright &copy; 2015-2019 Robert Quinn</p>
      </body>
    </div>
  );
}

export default App;
